        size_Wcn1=size_Lcn1+random()*(size_Wcn1_max-size_Lcn1)/RAND_MAX;
        size_Lcn2=size_Lcn2_min+random()*(size_Lcn2_max-size_Lcn2_min)/RAND_MAX;
        size_Wcn2=size_Lcn2+random()*(size_Wcn2_max-size_Lcn2)/RAND_MAX;
        size_Ldp1=size_Ldp1_min+random()*(size_Ldp1_max-size_Ldp1_min)/RAND_MAX;
        size_Wdp1=size_Ldp1+random()*(size_Wdp1_max-size_Ldp1)/RAND_MAX;
        size_Ldp2=size_Ldp2_min+random()*(size_Ldp2_max-size_Ldp2_min)/RAND_MAX;
        size_Wdp2=size_Ldp2+random()*(size_Wdp2_max-size_Ldp2)/RAND_MAX;
        size_Ldn1=size_Ldn1_min+random()*(size_Ldn1_max-size_Ldn1_min)/RAND_MAX;
        size_Wdn1=size_Ldn1+random()*(size_Wdn1_max-size_Ldn1)/RAND_MAX;
        size_Ldn2=size_Ldn2_min+random()*(size_Ldn2_max-size_Ldn2_min)/RAND_MAX;
        size_Wdn2=size_Ldn2+random()*(size_Wdn2_max-size_Ldn2)/RAND_MAX;
        size_Iref=size_Iref_min+random()*(size_Iref_max-size_Iref_min)/RAND_MAX;
